import React from 'react';
import { Button } from 'react-bootstrap';
import { Link } from 'react-router-dom';

function Home() {
  return (
    <div className="container text-center mt-5">
      <h1>Welcome to the Home Page</h1>
      <Link to="/BigBack">
        <Button variant="primary">Play</Button>
      </Link>
    </div>
  );
}

export default Home;
